import styles from "../../Css/Cart.module.css";
function CartHeader ()  {
    return (
        <div className={styles.cart_title_wrap}>
        <div className={styles.tab_title}>
          <input type="checkbox" />
          <span>상품정보</span>
          <span>수량</span>
          <span>상품금액</span>

          <p>전체선택</p>
        </div>
      </div>
    );
}

export default CartHeader;
